// Profile.js
import React, { useEffect, useState, useCallback } from "react";
import { useParams, Link } from "react-router-dom";
import {
  getUserData as getMockedUserData,
  getUserActivity as getMockedUserActivity,
  getUserAverageSessions as getMockedUserAverageSessions,
  getUserPerformance as getMockedUserPerformance,
} from "../../services/apiMock.js";
import {
  getUserData as getBackendUserData,
  getUserActivity as getBackendUserActivity,
  getUserAverageSessions as getBackendUserAverageSessions,
  getUserPerformance as getBackendUserPerformance,
} from "../../services/apiBackend.js";
import BarChartComponent from "../../components/BarChart/BarChart.js";
import SideCard from "../../components/SideCard/SideCard.js";
import RadialBarChartScore from "../../components/RadialBarChart/RadialBarChart.js";
import PerformanceRadarChart from "../../components/RadarChart/RadarChart.js";
import LineChartComponent from "../../components/LineChart/LineChart.js";
import caloriesIcon from "../../assets/images/sidecard-icons/calories.svg";
import glucidesIcon from "../../assets/images/sidecard-icons/glucides.svg";
import lipidesIcon from "../../assets/images/sidecard-icons/lipides.svg";
import proteinesIcon from "../../assets/images/sidecard-icons/proteines.svg";
import "./profile.css";

const Profile = () => {
  const { id } = useParams();
  const [userData, setUserData] = useState(null);
  const [userActivity, setUserActivity] = useState(null);
  const [userAverageSessions, setUserAverageSessions] = useState(null);
  const [userPerformance, setUserPerformance] = useState(null);
  const [loading, setLoading] = useState(true);

  const fetchData = useCallback(async (useMockData) => {
    try {
      const getUserData = useMockData ? getMockedUserData : getBackendUserData;
      const getUserActivity = useMockData ? getMockedUserActivity : getBackendUserActivity;
      const getUserAverageSessions = useMockData ? getMockedUserAverageSessions : getBackendUserAverageSessions;
      const getUserPerformance = useMockData ? getMockedUserPerformance : getBackendUserPerformance;

      const user = await getUserData(id);
      const activity = await getUserActivity(id);
      const sessions = await getUserAverageSessions(id);
      const performance = await getUserPerformance(id);

      setUserData(user);
      setUserActivity(activity);
      setUserAverageSessions(sessions);
      setUserPerformance(performance);
      setLoading(false);
    } catch (error) {
      if (!useMockData) {
        fetchData(true); // Utilisation de useCallback pour garantir que fetchData ne change pas de r√©f√©rence
      } else {
        setLoading(false);
        console.error(error);
      }
    }
  }, [id]);

  useEffect(() => {
    fetchData(false);
  }, [fetchData]);

  if (loading) return <p>Chargement du profil...</p>;
  if (!userData || !userData.userInfos || !userData.userInfos.firstName) return <p>Aucun profil trouv√©</p>;

  const { keyData, todayScore, score, userInfos } = userData;
  const userScore = todayScore || score;
  const switchUserId = id === "12" ? "18" : "12";

  return (
    <section className="profile-container">
      <header className="header">
        <h1>
          Bonjour <span>{userInfos.firstName}</span>
        </h1>
        <h2>F√©licitations ! Vous avez explos√© vos objectifs hier üëè</h2>
        <Link to={`/profile/${switchUserId}`}>
          <button className="switch-user-btn">Changer de profil</button>
        </Link>
      </header>
      <section className="main-content">
        <section className="bar-chart">
          <BarChartComponent data={userActivity.sessions} />
        </section>
        <section className="line-chart">
          <LineChartComponent data={userAverageSessions.sessions} />
        </section>
        <section className="radar-chart">
          <PerformanceRadarChart
            performanceData={userPerformance.data}
            kind={userPerformance.kind}
          />
        </section>
        <section className="radial-bar-chart">
          <RadialBarChartScore score={userScore} />
        </section>
        <section className="sidecard">
          <SideCard
            icon={caloriesIcon}
            value={`${keyData.calorieCount}kCal`}
            label="Calories"
            bgColor="#FFEBE5"
          />
          <SideCard
            icon={proteinesIcon}
            value={`${keyData.proteinCount}g`}
            label="Prot√©ines"
            bgColor="#E5F1FF"
          />
          <SideCard
            icon={glucidesIcon}
            value={`${keyData.carbohydrateCount}g`}
            label="Glucides"
            bgColor="#FFF5DB"
          />
          <SideCard
            icon={lipidesIcon}
            value={`${keyData.lipidCount}g`}
            label="Lipides"
            bgColor="#FFE5E5"
          />
        </section>
      </section>
    </section>
  );
};

export default Profile;
